import React, { useState } from 'react';
import LoginPage from './Components/LoginPage/LoginPage';
import CreateAccountPage from './Components/CreateAccountPage/CreateAccountPage';
import Dashboard from './Components/Dashboard/Dashboard';
// import Navbar from './Components/Navbar/Navbar';
// import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
// import Home from './pages';
// import About from './pages/about';
// import Events from './pages/events';
// import AnnualReport from './pages/annual';
// import Teams from './pages/team';
// import Blogs from './pages/blogs';
// import SignUp from './pages/signup';


import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import navbar from "./Components/Navbar/Navbar"
import Dogs from "./Components/Navbar/Dogs"
import Cats from "./Components/Navbar/Cats"
import Sheeps from "./Components/Navbar/Sheeps"



const App = () => {
  const [currentPage, setCurrentPage] = useState('login');

  const handlePageChange = (page) => {
    setCurrentPage(page);
  };

  const renderPage = () => {
    <Navbar/>
    if (currentPage === 'login') {
      return <LoginPage onPageChange={handlePageChange} />;
    } else if (currentPage === 'createAccount') {
      return <CreateAccountPage onPageChange={handlePageChange} />;
    } else if (currentPage === 'dashboard') {
      return <Dashboard />;
    }

    <Router>
      <navbar />
      <Switch>
        <Route path='/' exact component={Dogs} />
        <Route path='/cats' component={Cats} />
        <Route path='/sheeps' component={Sheeps} />
        <Route path='/goats' component={Goats} />
      </Switch>
    </Router>
  };

  return <div>{renderPage()}</div>;
};


export default App;
